Native MongoDB: Why is my switch statement not working with field names but only hard coded values?<p>Problem: I was trying to find a way to only update my lastModified field, if user inputted field values actually change on update. Originally, I included the lastModified field in the (non-aggregate) $set object, which always updated it as new Date() changes even if the other update fields don't. This led to misleading timestamp records.</p>
<p>Eventually I was able to get a solution using aggregation in update but, something doesn't quite work as I expected it to. I can only assume it's a bug unless my understanding is wrong. Please see the code snippets.</p>
<p>Correction: Neither of the below works (<strong>However</strong>, they do work if I hard replace the field path with values e.g. changing '$firstName' to 'Steve' works)</p>
<pre><code>{
    $set: {
        lastModified: {
            $switch: {
                branches: [
                    {
                        case: {
                            $ne: ['$firstName', firstName],
                        },
                        then: new Date(),
                    },
                    {
                        case: {
                            $ne: ['$lastName', lastName],
                        },
                        then: new Date(),
                    },
                ],
                default: '$lastModified',
            },
        },
    },
},
</code></pre>
<pre><code>{
    $set: {
        lastModified: {
            $switch: {
                branches: [
                    {
                        case: {
                            $not: { $eq: ['$firstName', firstName] }
                        },
                        then: new Date(),
                    },
                    {
                        case: {
                            $not: { $eq: ['$lastName', lastName] }
                        },
                        then: new Date(),
                    },
                ],
                default: '$lastModified',
            },
        },
    },
},
</code></pre>
<p>If anyone can provide some clarity with this, I'd greatly appreciate it.</p>
<p><strong>Edit: Further details added</strong></p>
<pre><code>// firstName = 'Steve', lastName = 'Jobs'
// In db, $firstName field = 'John', $lastName field = 'Doe'
// the intention is to compare user input with db fields and 
// detect changes using the switch statement
const { firstName, lastName } = req.body

db.collection.updateOne(
    { _id },
    [
        {
            $set: {
                firstName,
                lastName,
            },
        },
        {
            $set: {
                lastModified: {
                    $switch: {
                        branches: [
                            {
                                case: {
                                    $not: {
                                        $eq: ['$firstName', firstName],
                                    },
                                },
                                then: new Date(),
                            },
                            {
                                case: {
                                    $not: {
                                        $eq: ['$lastName', lastName],
                                    },
                                },
                                then: new Date(),
                            },
                        ],
                        default: '$lastModified',
                    },
                },
            },
        },
    ],
    { ignoreUndefined: true },
)
</code></pre>
<p>I expect the db document to change from</p>
<pre><code>{
    firstName: 'John',
    lastName: 'Doe',
    lastModified: ~previous timestamp~
}
</code></pre>
<p>to</p>
<pre><code>{
    firstName: 'Steve',
    lastName: 'Jobs',
    lastModified: ~new timestamp~
}
</code></pre>
<p>however I get</p>
<pre><code>{
    firstName: 'Steve',
    lastName: 'Jobs',
    lastModified: ~previous timestamp~
}
</code></pre>
<p>It only works if one of the two variables are hardcoded i.e.</p>
<pre><code>case: {
    $not: {
        $eq: ['$firstName', firstName],
    },
    then: 'DOES NOT enter here'
},
case: {
    $not: {
        $eq: ['John', firstName],
    },
    then: 'DOES enter here'
},
case: {
    $not: {
        $eq: ['$firstName', 'Steve'],
    },
    then: 'DOES enter here'
},
</code></pre>
<p>For now, I've decided (for now) to use two queries to update the lastModified field, but I don't really like this approach at all. The second query is:</p>
<pre><code>if (modifiedCount &gt; 0 || upsertedCount &gt; 0) {
    dbCollection
            .updateOne(filter, update)
            .catch((err) =&gt; console.error(err))
}
</code></pre>

