<p>to access the workoutName above, <em>Below</em> I have set the value to <code>postData.workouts[&quot;workoutName&quot;]</code> seems to work but unsure. I am having trouble on the <em>onChange</em> property, specifically with the second argument in <em>setPostData</em> <code>[workoutName]: e.target.value</code>. I am having trouble accessing the <code>workoutName</code> key within the workouts dictionary from the schema.</p>
