MongoDB pipeline conditional counting<p>Documents in a collection contain <code>title</code>  and <code>active</code> fields. The <code>active</code> field is boolean. My goal is to group by <code>title</code> and count all the records. Lastly, I want to count the documents where <code>active</code> is true.</p>
<p>This query does the counting, but <strong>total and active are always equal</strong>. Why isn't the conditional counting only the documents where <em>active is <code>true</code></em>?</p>
<p>Here is my pipeline:</p>
<pre><code>[
    { 
        &quot;$group&quot; : { 
            &quot;_id&quot; : { 
                &quot;student᎐campus᎐title&quot; : &quot;$student.campus.title&quot;
            }, 
            &quot;total&quot; : { 
                &quot;$sum&quot; : NumberInt(1)
            }, 
            &quot;active&quot; : { 
                &quot;$sum&quot; : { 
                    &quot;$cond&quot; : [
                        { 
                            &quot;active&quot; : true
                        }, 
                        1.0, 
                        0.0
                    ]
                }
            }
        }
    }
]
</code></pre>

